import './Footer.css';

function Footer() {
  return (
    <div className='footer-container'>
        <p className='footer-item footer-format'>S P A D A T A S</p>
        <p className='footer-item footer-format'>Security and Privacy in Academic Data management at Schools</p>

        <div className='footer-item'>
            <p className='footer-baseline footer-format'>© 2023 — Made by </p>
            <p className='footer-author'>XXXXX</p>
        </div>
       
        <div className='footer-item footer-format'>
            <p className='footer-baseline footer-format'>More at </p>
            <a className='footer-link' href="spadatas.eu">spadatas.eu</a>
        </div>


    </div>
  );
}

export default Footer;
